          title: 'Ácido 5 Hidróxi Indolacético',
          text: "\n                            <p>Seguir instru\xE7\xF5es de coleta de urina de 24 horas FO-032. O frasco cont\xE9m \xE1cido cuja fun\xE7\xE3o \xE9 de conservar a urina, n\xE3o devendo, portanto ser desprezado.</p>\n                            <ul>\n                                <li>Durante as 24 horas da coleta do exame n\xE3o fazer uso de: abacate, abacaxi, ameixa, banana, berinjela, pickles, nozes e tomate;</li>\n                                <li>Permanecer as 24 horas sem ingerir os seguintes medicamentos conforme orienta\xE7\xE3o de seu m\xE9dico assistente: Acetaminofen, \xC1cido Ac\xE9tico, \xC1cido Dehidroxifenilac\xE9tico, \xC1cido Gent\xEDsico , \xC1cido Homogent\xEDsico, Fenotiazinas, Formalde\xEDdo, Imipramina, Isoniazida, Inibidores de Mao, L-Dopa, Levodopa, Morfina, Naproxifeno, Saliciatos, xaropes para tosse com gliceril guacolato. A suspens\xE3o ou n\xE3o de medicamentos \xE9 crit\xE9rio exclusivo do seu m\xE9dico.</li>\n                                <li>N\xE3o fazer esfor\xE7o f\xEDsico durante a coleta;</li>\n                                <li>O cliente deve manter sua rotina di\xE1ria;</li>\n                                <li>N\xE3o \xE9 necess\xE1rio aumentar a ingest\xE3o de l\xEDquidos, exceto sob orienta\xE7\xE3o m\xE9dica;</li>\n                                <li>Informar medicamentos em uso, volume, hor\xE1rio inicial e final da coleta, dosagem, dia e hora da \xFAltima dose;</li>\n                                <li>Crian\xE7as at\xE9 10 anos informar peso e altura.</li>\n                            </ul>\n                        ",
