          text: "\n                            <h4 class=\"text-uppercase\">Bacterioscopia de urina e Antibiograma</h4>\n                            <ul>\n                                <li>Informar o uso de antibi\xF3tico nos \xFAltimos 7 dias (o uso de antibi\xF3ticos n\xE3o impede a realiza\xE7\xE3o da cultura, mas pode interferir no resultado);</li>\n                                <li>As amostras devem ser colhidas preferencialmente no laborat\xF3rio;</li>\n                                <li>Colher a primeira urina da manh\xE3, ou pelo menos, estar 2 horas sem urinar;</li>\n                                <li>Lavar as m\xE3os;</li>\n                                <li>Abrir o pacote de len\xE7o umedecido;</li>\n                                <li>\n                                    <b>Feminino:</b> fazer a higieniza\xE7\xE3o da regi\xE3o genital (sempre da regi\xE3o genital para a regi\xE3o anal e nunca ao contr\xE1rio, para evitar contamina\xE7\xE3o, afastando os grandes l\xE1bios).<br>\n                                    <b>Masculino:</b> exponha a glande, mantenha o prep\xFAcio (pele), retra\xEDdo e fa\xE7a a higiene na regi\xE3o genital.\n                                </li>\n                                <li>Utilize o len\xE7o na regi\xE3o genital somente uma vez;</li>\n                                <li>Ap\xF3s a higieniza\xE7\xE3o despreze o 1\xBA jato de urina no vaso sanit\xE1rio e colha o jato m\xE9dio no frasco est\xE9ril fornecido no laborat\xF3rio, despreze o final;</li>\n                                <li>Desprezar o resto da urina que ficar no pote sem tampa no vaso sanit\xE1rio e jogar o mesmo no lixo;</li>\n                                <li>Entregar o tubo contendo a amostra a um de nossos colaboradores;</li>\n                                <li>\n                                    Em caso de coleta em casa:<br>\n                                    a) entregar o material em at\xE9 30 minutos em temperatura ambiente;<br>\n                                    b) se refrigerada em at\xE9 3 horas.\n                                </li>\n                            </ul>\n                            <h4 class=\"text-uppercase\">Observa\xE7\xF5es Importantes:</h4>\n                            <ul class=\"abecedario\">\n                                <li>Mulheres durante o per\xEDodo menstrual, colocar tamp\xE3o vaginal antes de colher a urina;</li>\n                                <li>Crian\xE7as que usam fraldas:</li>\n                            </ul>\n                            <ul class=\"circle\">\n                                <li>A amostra tem que ser colhida no laborat\xF3rio devido \xE0 necessidade de antissepsia e coloca\xE7\xE3o apropriada do saco coletor;</li>\n                                <li>Se n\xE3o houver urg\xEAncia, a crian\xE7a dever\xE1 tomar banho em casa, antes de chegar \xE0 unidade, para a coleta de urina;</li>\n                                <li>Nos meninos, recomenda-se realizar a higiene do prep\xFAcio com sabonete l\xEDquido.</li>\n                            </ul>\n                            <p>O Laborat\xF3rio n\xE3o realiza a passagem de sonda vesical.</p>\n                        ",
